import React from 'react'
import Task from './Task'

const TaskList = ({ tasks}) => {
    return (
        <div className=''>
            {
                tasks.map(task => {
                    <Task task={task} />
                })
            }
            <Task />
        </div>
    )
}

export default TaskList
